import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css';

// <App /> eshte Komponenti i pare i cili shfaqet(render) ne nje div me id="root"
// Ky div gjendet ne folderin public te index.html ne fund

ReactDOM.render(<App />, document.getElementById('root'));
